import {useState} from "react"
import * as style from "./style/css"
import ProfileTotalItem from "./profileTotalItem"
import ProfileTotalInput from "./profileTotalInput";
import SimpleBarReact from 'simplebar-react';

// Extends Main //
export default function ProfileTotal({
  totalToRenderNumber, setTotalToRenderNumber, profileDataToRender, listToRender}) {
    
  const [userInputRecord, setUserInputRecord] = useState("");

  // Renders each total item //
  // What's rendered is dependent on the listToRender state //
  const renderTotalItems = () => {
    return listToRender?.map(item => (
      <ProfileTotalItem
        item={item}
        style={style}
        profileDataToRender={profileDataToRender}/>
    ));
  };


  // Renders all components of ProfileTotal //
  return (
    <div style={style.totalContainer}>
      <div style={style.totalTitleMain}>Total Count:</div>
      <SimpleBarReact>
        {renderTotalItems()}
      </SimpleBarReact>
      <ProfileTotalInput
        style={style} 
        totalToRenderNumber={totalToRenderNumber} 
        userInputRecord={userInputRecord}
        setUserInputRecord={setUserInputRecord} 
        setTotalToRenderNumber={setTotalToRenderNumber}/>
    </div>
  );
};
